<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Verify Your Email</title>
    <style>
        body {
            margin: 0;
            padding: 0;
            background-color: #121212;
            color: #ffffff;
            font-family: Arial, sans-serif;
        }
        .container {
            width: 100%;
            max-width: 600px;
            margin: 0 auto;
            padding: 20px;
        }
        .header {
            text-align: center;
            padding: 20px;
            background-color: #1e1e1e;
            border-bottom: 1px solid #333333;
        }
        .header img {
            max-width: 200px;
        }
        .content {
            padding: 20px;
            background-color: #1e1e1e;
        }
        .content h1 {
            font-size: 24px;
            margin-bottom: 20px;
        }
        .content p {
            font-size: 16px;
            line-height: 1.5;
        }
        .token {
            display: block;
            width: fit-content;
            margin: 20px auto;
            padding: 10px 20px;
            background-color: #333333;
            border-radius: 5px;
            font-size: 18px;
            letter-spacing: 1px;
        }
        .footer {
            text-align: center;
            padding: 10px;
            background-color: #1e1e1e;
            border-top: 1px solid #333333;
        }
        .footer p {
            font-size: 14px;
        }
        @media screen and (max-width: 600px) {
            .container {
                padding: 10px;
            }
            .content h1 {
                font-size: 20px;
            }
            .content p {
                font-size: 14px;
            }
        }
    </style>
</head>
<body>
    <div class="container">
        <div class="header">
            <img src="data:image/png;base64,"
            alt="Operis Mail" />
        </div>
        <div class="content">
            <h1>Verify Your Email</h1>
            <p>Thank you for registering with our application. To complete your registration, please verify your email by using the verification token below:</p>
            <div class="token">{token}</div>
            <p>If you did not request this email, please ignore it.</p>
        </div>
        <div class="footer">
            <p>&copy; 2024 Operis. All rights reserved.</p>
        </div>
    </div>
</body>
</html>
